('1929','18','7613','Villa Weber Bendinat',Null,'Hochwertige Villa in exklusiver Lage von Bendinat','24388','Diese luxuriöse 4-Schlafzimmer-Villa mit Südorientierung befindet sich auf einem leichten Hanggrundstück in bevorzugter Villenwohnlage von Bendinat, in der Nähe mehrerer Yachthäfen und Golfplätze. Der licht durchflutete Wohnbereich mit einer attraktiven Raumaufteilung bietet sowohl einen großen Wohn-Essbereich wie auch ein separaten Salon mit fast komplett verglaster Fensterfront und wunderbarem Meer- und Panoramablick. Auf der Eingangsetage befinden sich 2 Schlafzimmer mit Bädern en suite. Die zwei großzügigen Schlafzimmer im Obergeschoss verfügen über einen direkten Terrassenzugang mit traumhaft schönem Meerblick.\r\nNeben schönen freien und überdachten Terrassen mit großem Swimmingpool und Wellness –Oase, steht eine Doppelgarage zur Verfügung. Eine  geschmackvolle, hochwertige Möblierung und die gute Bauqualität runden das Angebot ab.','24389','2350000','111','2012-12-11 16:31:53','106','2012-12-11 16:32:26',Null,'1666','72','768',1,'1','0',Null,Null,Null,'24390',Null,'0','0','0',Null,'2016-02-26 10:26:42',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'24391',Null,'24392',Null,'24393',Null,'24394',Null,'24395','0',0,'0');
